activity.description:
Nuclear Methods in Earth Systems uses isotopic and nuclear techniques to trace the impact of humans on the environment. Earth systems science recognises that knowledge of the history of environmental variability and human-environment interactions improves our understanding of the functioning of Earth systems and their response, or vulnerability, to current and future impacts. The techniques and instruments used by researchers in this group enable them to reconstruct human impacts on ecosystems over the past 8000 years. The Nuclear Methods in Earth Systems group have formed partnerships and collaborations with many of the worlds leading research institutes, and undertake fieldwork on sites around Australia, and the world. Study areas include:&#13;
&#13;
- Tracing Human Impacts on Earth Systems &#13;
- Contaminant Science &#13;
- Nuclear Methods in the Carbon Cycle

party.description:
Dr Elliot Gilbert leads the project for the design, construction, commissioning of the state-of-the-art SANS instrument (Quokka) at the OPAL reactor.  Elliot is also leader of the of the Food Science project that seeks to apply a materials science approach to the study of structure and dynamics in food-based systems.&#13;
&#13;
 He received his PhD in chemistry from the Australian National University in 1998. Following an ARC/SPIRT Industrial Postdoctoral Fellowship,  he joined the Small-Angle Scattering Group at the Intense Pulsed Neutron Source at Argonne National Laboratory in 1999 where he provided scientific and technical assistance to users of the small-angle scattering instruments. Elliot's interests lie in soft condensed matter science and he has investigated such diverse areas as emulsion stabilisation, polymers in confined geometry and phase separation in paraffins but   now has an increasing focus on naturally occurring materials. He has recently written a review on the application of neutron scattering in food science

