Tao Wei is a Materials Engineer with a background in the areas of steels, zirconium alloys, aluminum alloys, high temperature ceramics, and materials modelling. Tao Wei joined ANSTO in 2002. Since then he has carried out the research activities ranging from accelerator mass spectrometry projects to surveillance programs for the&#13;
structure integrity of ANSTO's reactors. He has utilised various materials&#13;
characterisation and mechanical testing techniques, and finite element analysis to develop and evaluate the nuclear materials under the extreme environment.
